<script lang="ts">
  import Admin from '@/Shared/Admin.vue';
  // import UserIndex from '@/Pages/Admin/Index/User.vue'
  import { defineComponent } from 'vue';
  import _ from "lodash";

  export default defineComponent({
    name: 'Admin-Index',

    layout: Admin,

    components: {
      // 'user-index': UserIndex,
    },

    props: {
      routes: Object,
    },

    data()
    {
      return {
        tiles: {},
      }
    },

    mounted()
    {
      _.forEach(this.routes, (route, title) => {
        this.getData(route, title)
      })
    },

    methods: {
      getData(route, title)
      {
        axios.get(route)
             .then((response) => {
               this.tiles[title] = response.data.message
             })
      },

      hasTile(name)
      {
        return this.tiles.hasOwnProperty(name)
      }
    },
  })
</script>
